message:
Intervenção federal seria nesses termos : 
CF:
Art. 34. A União não intervirá nos Estados nem no Distrito Federal, exceto para:
I - manter a integridade nacional;
II - repelir invasão estrangeira ou de uma unidade da Federação em outra;
III - pôr termo a grave comprometimento da ordem pública;
IV - garantir o livre exercício de qualquer dos Poderes nas unidades da Federação;
V - reorganizar as finanças da unidade da Federação que:
a) suspender o pagamento da dívida fundada por mais de dois anos consecutivos, salvo motivo de força maior;
b) deixar de entregar aos Municípios receitas tributárias fixadas nesta Constituição, dentro dos prazos estabelecidos em lei;
VI - prover a execução de lei federal, ordem ou decisão judicial;
VII - assegurar a observância dos seguintes princípios constitucionais:
a) forma republicana, sistema representativo e regime democrático;
b) direitos da pessoa humana;
c) autonomia municipal;
d) prestação de contas da administração pública, direta e indireta.

Atenção ao inciso VII, alínea ‘a’, que seria o que mais se assemelha com a causa, porém para pedir isso não precisaria pedir as forças armadas e sim a união. Não faz sentido. Sem falar que o contexto do art foge um pouco do sentido, o art fala sobre intervir em um estado, nesse caso a intervenção diz respeito a todo o país. Então assim daria para pedir isso sim, mas não a militar. 

DE TODA FORMA, VOCÊS NÃO SÃO JURISTA, PEÇAM “SOS FFAA” , AJUDEM
O POVO, E OS MILITARES SABERÃO O QUE FAZER. 

